import React from 'react';
import navbarLogo from './navbar-logo.png';
import navbarExplore from './explore-icon.png';
import navbarHeart from './navbar-heart.png';
import './App.css';


function App() {
  return (
    <div className="Feed">
      <Navbar />
    </div>
  )
}

class Navbar extends React.Component {
  render() {
    return (
      <div>
        <img src={navbarLogo} alt="navbar logo" height="150px" width="200px"/>
        <input type="text" placeholder="Search"></input>
        <img src={navbarExplore} alt="Explore icon" height="50px" width="50px"/>
        <img src={navbarHeart} alt="notification icon" height="40px" width="50px"/>
      </div>
    )
  }
}

export default App;
